import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser ,faCog ,faSuitcaseRolling} from '@fortawesome/free-solid-svg-icons'
import { Link } from 'react-router-dom';

function VehicleCard(props){
    return(
        <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="assets/nisan_neo.jpg" />
  <Card.Body>
    <Card.Title>{props.data.make} {props.data.model}</Card.Title>
    <Card.Text>
    <Row>
    <Col>Plate Number : {props.data.plateNum}</Col>
    </Row>
    <Row>
    
    <Col><FontAwesomeIcon icon={faCog} />{props.data.transmission}</Col>
    <Col> <FontAwesomeIcon icon={faUser} /> Number of seats:{props.data.numOfSeats}</Col>
    <Col>Tank Capacity{props.data.tankCapacity} ltr</Col>
    <Col><FontAwesomeIcon icon={faSui} />luggage : {props.data.luggageWeight} Kg</Col>
    
    </Row>
    </Card.Text>
    <Row>
      <Col><Button variant="primary">Book</Button></Col>
      <Col>Rs.{props.data.priceRate}</Col>
    </Row>
  </Card.Body>
</Card>
    // <div className="card">
